import range from "../utils/range"

const Table = () => {
  const data = range(1, 16)

  return (
    <div>
      <table>
        <tbody>
          {data.map((el, i) => {
            return <div></div>
          })}
        </tbody>
      </table>
    </div>
  )
}

export default Table
